    'tiger': "There might be some conflict between you two, but in a way that keeps things fresh and exciting rather than dangerously tense. It may take some time to get a steady fire going, but once you do, you'll enjoy the warmth of a friendship that will feel much like huddling around a campfire, roasting marshmallows and sharing secrets under a starry sky.",
