    'dragon': "Highly compatible from the start, you two complement each other perfectly! Together you'll lay down a solid, united foundation brick by brick, and your friendship will only grow closer and stronger as time goes by. As long as you can continue to treat each other with trust, honesty, and warmth, your bond is sure to withstand any trial.",
