    'rooster': "You both take pleasure in each other's happiness, making for a warm and comfy friendship in which one good turn infinitely begets another. FIRSTNAME will be your trusty anchor in the storm, just as you'll be FIRSTNAME's! As long as you check in with each other every once in a while to make sure you're on the same page, your friendship will endure.",
