  //   'rabbit': "Being together feels like home, like being alone in the best way. You may not make a show of saying your mushy feelings aloud, but your friendship will hold steady and firm, supported by the sum of the small moments you share. Trust each other with your insecurities, and be honest even when it's difficult. Together you'll make it through the storm.",
  //   'dragon': "There might be some conflict between you two, but in a way that keeps things fresh and exciting rather than dangerously tense. It may take some time to get a steady fire going, but once you do, you'll enjoy the warmth of a friendship that will feel much like huddling around a campfire, roasting marshmallows and sharing secrets under a starry sky.",
  //   'snake': "You're a bit of an unconventional pairing, but somehow it just works! While your connection may suffer some fledgling growing pains, if you strive to embrace your differences and learn from each other, your friendship will glow up and probably get some kind of Instagram modeling deal. Jump in! A world of new and exciting possibilities awaits you!",
  //   'horse': "Your friendship promises to be a bit of a rollercoaster ride, full of ups and downs and hurtling twists. While the drops may leave you feeling blindsided and dazed, the spectacular highs will bring you back together again. Practice patience and empathy during the low points, and you'll soon find that the track ahead is just one clear stretch home.",
  //   'goat': "You might not be the most demonstrative of friends, but why would you need to be? Your solid connection, built upon a deep and implicit understanding of each other, doesn't need words to make itself felt. All the same, it never hurts to let a buddy know how much they mean to you. You can even say 'don't be weird about it' after, if you must.",
  //   'monkey': "Be sure to vocalize your feelings and preferences clearly, as FIRSTNAME is more than willing to follow your lead! If you take the initiative in keeping up a steady exchange of honest communication, your friendship can only grow stronger. Make sure to show your appreciation for FIRSTNAME in turn, and you two are bound to stand the test of time.",
  //   'rooster': "Your common interests (once you discover them) will make growing closer as easy as starting the first vital conversation about that thing it turns out you both like, but beware not to make assumptions about FIRSTNAME's opinions! Your similarities might draw you together, but the way you navigate your differences will make or break your friendship.",
  //   'dog': "When you two are just starting out, you may feel like you're constantly scrambling to find your footing and the right words to express yourself with. Instead of fretting over your insecurities, try letting FIRSTNAME take the reins! With time, this will bring you back to familiar ground, letting you feel right at home in your friendship.",
  //   'pig': "Though the two of you may not get along right from the get-go, once you do get going you'll go, and go, and go! While your disagreements may result in heated arguments, as long as you both remember in tense moments to take a step back to preserve each other's pride, you'll enjoy a dynamic and close friendship without a dull moment in sight.",
